description:
Me qëllimin për t’iu ofruar gjithmonë atë për të cilën keni nevojë, sjellim aplikacionin My One.
Të përshtatur për ju dhe çdo nevojë tuajën, vetëm me një klikim:
- Hyr në aplikacion nga profili yt në Facebook;
- Kontrollo balancën dhe njësitë e mbetura;
- Rimbush çdo numër One;
- Merr ofertën tënde të personalizuar;
- Aktivizo çdo paketë;
- Shkarko në format PDF dhe paguaj çdo faturë;
- Paguaj me çdo kartë bankare, thjeshtë dhe sigurt;
- Ruaj kartën bankare për përdorim të thjeshtë më vonë;
- Shkëmbe njësitë që nuk do dhe merr njësitë që do më shumë;
- Gjej dyqanet One pranë teje;
- Kontakto Shërbimin ndaj Klientit 24/7.

Platforma e shërbimeve elektronike e-Kosova është sportel elektronik, përmes të cilit çdo person i interesuar mund të marrë nëpërmjet internetit shërbime elektronike që ofrohen nga institucionet publike në Kosovë, duke shkurtuar distancën, rritur efikasitetin dhe shpejtësinë e marrjes së shërbimit.

Platforma eKosova, menaxhohet dhe administrohet nga Agjencia e Shoqërisë së Informacionit.

Disa informatat rreth e-Kosova:
- Është dritarja e vetme nëpërmjet së cilës ofrohen në mënyrë elektronike shërbimet e institucioneve publike;
- Ofron shërbime publike 24/7/365;
- Ofron shërbime elektronike të standardeve më të fundit të teknologjisë;
- Ofron mundësi për kryerjen e pagesave “Online” për shërbime, nëpërmjet kartave të debitit dhe kreditit, pavarësisht klient i cilës bankë jeni;
- Ofron informacione për shërbimet elektronike lidhur me procedurën dhe dokumentet e nevojshme për marrjen e shërbimit;
- Është në përputhje të plotë me politikat e sigurisë kibernetike për mbrojtjen e të dhënave të përdoruesve;
- Ofron mundësi komunikimi për çdo paqartësi, pyetje apo problem mbi regjistrimin, shërbimet e ofruara në eKosova, përmes forumit të platformës, postës elektronike, komenteve dhe mesazheve në rrjetet sociale.
